import "./App.css";
import Navbar from "./components/Navbar"

function App() {
  return (
    <div>
      <Navbar/>

      <Router>
        <Route path="/" element={<Home/>}/>
        <Router path="/login" element={<Login/>} />
        <Router/></Router>
    </div>
  );
}

export default App;
